import React from 'react';
import Search from './Search';

function Nav(){
    return(
        <nav class="navbar navbar-expand-sm bg-dark navbar-dark">
            <h1><kbd>NEWS</kbd></h1>
            <Search/>
        </nav>
    )
}
export default Nav;
